import React from 'react';
import Select from 'react-select'


const ColumnInput=({onName,setColumnName})=>{
   
     console.log(onName);


    return(
        <Select options ={onName} style={{
            marginLeft: 20,
            width: 200,
        }}onChange={(e) => setColumnName(e.target.value)}/>
    )
    
}

export default ColumnInput;
